// src/pages/PaymentPage.js
import React, { useState } from 'react';
import { useLocation, useNavigate } from 'react-router-dom';
import './PaymentPage.css';

const PaymentPage = () => {
  const location = useLocation();
  const navigate = useNavigate();
  const { title, price, quantity, userDetails, selectedSeats } = location.state || {};

  const subtotal = price * quantity;
  const tax = subtotal * 0.05;
  const total = subtotal + tax;

  const [paymentMethod, setPaymentMethod] = useState('card');
  const [email, setEmail] = useState(userDetails?.email || '');
  const [cardDetails, setCardDetails] = useState({ number: '', expiry: '', cvc: '' });
  const [bankDetails, setBankDetails] = useState({ routing: '', account: '' });

  const handlePayment = () => {
    alert(`Processing payment of ₹${total}`);
    navigate('/payment-success');
  };

  return (
    <div className="payment-container">
      <div className="payment-left">
        <h2>Payment for {title}</h2>
        <p>{quantity} Tickets • Seats: {selectedSeats?.join(', ')}</p>

        <div className="payment-section">
          <label>Email</label>
          <input type="email" value={email} onChange={e => setEmail(e.target.value)} />
        </div>

        <div className="payment-section">
          <h3>Payment Method</h3>
          <div className="payment-options">
            <label>
              <input type="radio" value="card" checked={paymentMethod === 'card'} onChange={() => setPaymentMethod('card')} />
              Card
            </label>
            <label>
              <input type="radio" value="bank" checked={paymentMethod === 'bank'} onChange={() => setPaymentMethod('bank')} />
              Bank Account
            </label>
          </div>
        </div>

        {paymentMethod === 'card' && (
          <div className="payment-section">
            <label>Card Number</label>
            <input type="text" placeholder="1234 5678 9012 3456" value={cardDetails.number} onChange={e => setCardDetails({...cardDetails, number: e.target.value})} />
            <div className="card-info-row">
              <input type="text" placeholder="MM/YY" value={cardDetails.expiry} onChange={e => setCardDetails({...cardDetails, expiry: e.target.value})} />
              <input type="text" placeholder="CVC" value={cardDetails.cvc} onChange={e => setCardDetails({...cardDetails, cvc: e.target.value})} />
            </div>
          </div>
        )}

        {paymentMethod === 'bank' && (
          <div className="payment-section">
            <label>Routing Number</label>
            <input type="text" placeholder="123456789" value={bankDetails.routing} onChange={e => setBankDetails({...bankDetails, routing: e.target.value})} />
            <label>Account Number</label>
            <input type="text" placeholder="9876543210" value={bankDetails.account} onChange={e => setBankDetails({...bankDetails, account: e.target.value})} />
          </div>
        )}

        <button className="pay-button" onClick={handlePayment}>
          Pay ₹{total.toFixed(2)}
        </button>
      </div>

      <div className="payment-right">
        <h3>Order Summary</h3>
        <p><strong>Subtotal:</strong> ₹{subtotal.toFixed(2)}</p>
        <p><strong>Tax (5%):</strong> ₹{tax.toFixed(2)}</p>
        <p className="total"><strong>Total:</strong> ₹{total.toFixed(2)}</p>
      </div>
    </div>
  );
};

export default PaymentPage;
